import React from 'react'
import { AiOutlineFacebook,AiOutlineWhatsApp } from "react-icons/ai";
import { BsInstagram } from "react-icons/bs";
import { FaTwitter } from "react-icons/fa";

const Footer = () => {
  return (
    <div className='w-full bg-gray-900 text-gray-600 py-8 px-2 border-t-2'>
        <div className='flex flex-col items-center justify-center max-w-screen-xl mx-auto h-full px-3 py-12'></div>
    </div>
  )
}

export default Footer
